import React, { Component } from 'react';
import '../App.css';

class Map extends Component {
    constructor(props){
        super(props);
        this.state = {
            key: 'AIzaSyBxl0fjn6X9v2SCX1QdUFvFUGKj1MDmhUs'
        }
    }

    componentDidMount(){
        let map;

        function initMap() {
            map = new google.maps.Map(document.getElementById("map"), {
                center: { lat: -34.397, lng: 150.644 },
                zoom: 8,
            });
        }

        initMap();

    }

    render (){
        let containerStyle = {
            margin: '15px auto'
        }
        let titleStyle = {
            fontFamily: 'Rokkitt Extra Bold',
            textAlign: 'center'
        }
        let mapStyle = {
            background: '#000',
            maxWidth: '400',
            width: '300',
            margin: 'auto'

        }

        return (
            <div className={"container", "map-container"} style={containerStyle}>
                <h3 style={titleStyle}>WHERE AM I?</h3>
                <div id="map" style={mapStyle}></div>
            </div>
        )
    }
}

export default Map;
